import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
    	<div class="container">
	    	<h1>회사 홈페이지 헤더 메뉴</h1>
	    	<img src="/image/logo.png" title="회사 로고"/>
	    	<nav>
	    		<ul>
	    			<li class="active"><a href="#">홈</a></li>
	    			<li><a href="#">About</a></li>
	    			<li><a href="#">Corporation</a></li>
	    			<li><a href="#">Business</a></li>
	    			<li><a href="#">Contact Us</a></li>
	    		</ul>
	    	</nav>
    	</div>
    </header>
    </div>
  );
}

export default App;
